// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CertificateNFT is ERC721URIStorage, Ownable {
    uint256 public TokenId = 1;
    uint256[] public allIssuedCert;
    mapping(uint256 => string) public objectIDtoHash;
    mapping(uint256 => string) public metadataHashes;
    //mapping(uint256 => string) public objectID;
    mapping(uint256   => uint256) public objectIDToTokenId; // Mapping objectID to tokenId

    constructor() ERC721("CertificateNFT", "CERTNFT")  Ownable(msg.sender) {}

    event CertificateMinted(
        address indexed recipient,
        uint256 tokenId,
        string metadataHash,
        string objIDmetadataHash,
        uint256  objectID
    );

    // Mint a new certificate (only owner/admin)
    function mintCertificate(address recipient, string memory metadataHash, uint256 _objectID) external onlyOwner {
    //function mintCertificate(address recipient, string memory metadataHash) external onlyOwner {
        require(recipient != address(0), "Invalid recipient address");
        require(objectIDToTokenId[_objectID] == 0, "ObjectID already exists");
        require(bytes(metadataHash).length > 0, "Metadata hash is empty");

        require(bytes(metadataHashes[TokenId]).length == 0, "Metadata hash already exists for this tokenId");

        _safeMint(recipient, TokenId);
        //_setTokenURI(tokenId, metadataURI);

        metadataHashes[TokenId] = metadataHash;

        objectIDtoHash[_objectID] = metadataHash;
        //objectID[tokenId] = _objectID;

        // Map the objectID to the tokenId
        objectIDToTokenId[_objectID] = TokenId;

        emit CertificateMinted(recipient, TokenId, metadataHashes[TokenId],objectIDtoHash[_objectID],  _objectID);
        TokenId++;

        allIssuedCert.push(TokenId);

    }

    //Retrieve tokenId using objectID
    function getTokenIdFromObjectID(uint256  _objectID) external view returns (uint256) {
        return objectIDToTokenId[_objectID]; // Return the tokenId mapped to objectID
    }

    function getMetadataHashes(uint256 id) external view returns (string memory) {
        require(bytes(metadataHashes[id]).length > 0, "Metadata hash not found.");
        string memory hash = metadataHashes[id];
        return hash;  // Return the stored metadata hash for the token
    }

    function getMetadataHashFromObjectID(uint256 _objectID) external view returns (string memory) {
        require(bytes(objectIDtoHash[_objectID]).length > 0, "Metadata hash not found.");
        return objectIDtoHash[_objectID];  // Return the stored metadata hash for the objectID
    }

    // Check if a certificate exists and its owner
    function isCertificateValid(uint256 tokenId, address claimedOwner) external view returns (bool) {
        try this.ownerOf(tokenId) returns (address owner) {
            return owner == claimedOwner;
        } catch {
            return false;
        }
    }

    // Retrieve metadata URI for verification
