    function getAllIssuedCert() external view onlyOwner returns (uint256[] memory, string[] memory) {

        uint256 length = allIssuedCert.length;
        string[] memory metadata = new string[](length);

        for(uint256 i = 0; i < length; i++) {
            uint256 tokenID = allIssuedCert[i];
            metadata[i] = tokenURI(tokenID);
        }

        return (allIssuedCert, metadata);
    }

    function checkMetadataExists(uint256 tokenId) external view returns (bool) {
    return (bytes(metadataHashes[tokenId]).length > 0);
    }

    function objIdToHash(uint256 _objectID) external view returns (bool) {
        return (bytes(objectIDtoHash[_objectID]).length > 0);
    }

